import React from "react";
import '../../css/guideBook.css';
// import '../../css/custom.css';

const GuideBook = () => {

    const closeModel = () => {
        document.querySelector('.review-model').style.display = 'none';
    }
    return (
        <>
            <div className="review-model">
                <div className="model-content">
                    <button className="close-Btn" onClick={() => closeModel()}></button>
                    <h3>Guide Book</h3>
                </div>
            </div>
        </>
    )
}
export default GuideBook;
